/** Low level classes **/

// Global
var STARTED = false,
	GERROR = {
		ABORT: 1
	},
	PI2 = Math.PI * 2,
	PI2PART = Math.PI / 2,
	PI16PART = Math.PI / 16,
	PI64PART = Math.PI / 32;
	
function randInt (min, max) {
	return Math.round(Math.random() * (max - min)) + min;
}

// Keyboard
var keyboard = {
	//Real time
	key: {
		w: false,
		a: false,
		s: false,
		d: false,
		spacebar: false
	},
	//Was pressed once
	pressed: {
		w: false,
		a: false,
		s: false,
		d: false,
		spacebar: false
	}
};

keyboard.onKeyDown = function (e) {
	switch (e.keyCode) {
		case 87: //W
			keyboard.key.w = true;
			keyboard.pressed.w = true;
			break;
		case 65: //A
			keyboard.key.a = true;
			keyboard.pressed.a = true;
			break;
		case 83: //S
			keyboard.key.s = true;
			keyboard.pressed.s = true;
			break;
		case 68: //D
			keyboard.key.d = true;
			keyboard.pressed.d = true;
			break;
		case 32: //Spacebar
			keyboard.key.spacebar = true;
			keyboard.pressed.spacebar = true;
			break;
		case 27: //Escape
			//Always force to quit the game
			quit();
			break;
	}
};

keyboard.onKeyUp = function (e) {
	switch (e.keyCode) {
		case 87: //W
			keyboard.key.w = false;
			break;
		case 65: //A
			keyboard.key.a = false;
			break;
		case 83: //S
			keyboard.key.s = false;
			break;
		case 68: //D
			keyboard.key.d = false;
			break;
		case 32: //Spacebar
			keyboard.key.spacebar = false;
			break;
	}
};

keyboard.wasPressed = function (key) {
	if (this.pressed[key] === true) {
        this.pressed[key] = false;
        return true;
    }
	return false;
};

keyboard.reset = function () {
	this.pressed = {
		w: false,
		a: false,
		s: false,
		d: false,
		spacebar: false,
		escape: false,
		fsix: false
	};
};

keyboard.setup = function () {
	window.addEventListener("keydown", this.onKeyDown, false);
	window.addEventListener("keyup", this.onKeyUp, false);
};

keyboard.uninstall = function () {
	window.removeEventListener("keydown", this.onKeyDown);
	window.removeEventListener("keyup", this.onKeyUp);
};

// Mouse
var mouse = {
	pos: new Vector(0, 0)
};

mouse.onMouseMove = function (e) {
	mouse.pos.x = e.clientX;
	mouse.pos.y = e.clientY;
};

mouse.onMouseDown = function (e) {
	e.preventDefault();
	mouse.pressed = true;
	mouse.wasPressed = true;
};

mouse.onMouseUp = function (e) {
	mouse.pressed = false;
};

mouse.pressedOnce = function () {
	if (this.pressed === true) {
        this.pressed = false;
        return true;
    }
	return false;
};

mouse.setup = function (canvas) {
	canvas.addEventListener("mousemove", this.onMouseMove, false);
	canvas.addEventListener("mousedown", this.onMouseDown, false);
	canvas.addEventListener("mouseup", this.onMouseUp, false);
};

mouse.uninstall = function (canvas) {
	canvas.removeEventListener("mousemove", this.onMouseMove);
	canvas.removeEventListener("mousedown", this.onMouseDown);
	canvas.removeEventListener("mouseup", this.onMouseUp);
};

